return items.map(item => {
  let desc = item.json.description || "";

  // Remove HTML tags
  desc = desc.replace(/<[^>]+>/g, ' ');

  // Normalize spaces
  desc = desc.replace(/\s+/g, ' ').trim();

  return {
    json: {
      title: item.json.title,
      company: item.json.hiringOrganization?.name,
      location: item.json.jobLocation?.address?.addressLocality,
      country: item.json.jobLocation?.address?.addressCountry,
      description: desc,
      employmentType: item.json.employmentType,
      validThrough: item.json.validThrough
    }
  };
});

return items.map(item => {
  const raw = item.json.body;
  const jobData = JSON.parse(raw);

  return {
    json: {
      title: jobData.title,
      company: jobData.hiringOrganization?.name,
      description: jobData.description,
      location: jobData.jobLocation?.address?.addressLocality,
      country: jobData.jobLocation?.address?.addressCountry,
      employmentType: jobData.employmentType,
      validThrough: jobData.validThrough
    }
  };
});
